INSERT INTO `sys_oper_log` VALUES (589, '添加社区头条', 1, 'com.wr.estate.web.info.HeadlineController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/headline', '172.16.205.10', '', '{\"communityContent\":\"<p>乡村记忆活动是一种以乡村为主题的文化活动，旨在通过展览、演出、体验等形式，让人们了解和体验乡村的历史、文化和传统，促进乡村旅游和文化传承。</p><p><br></p><p>具体来说，乡村记忆活动包括以下几个方面：</p><ol><li>展览：通过展出乡村的老照片、老物件、手工艺品等，让人们了解乡村的历史和文化，感受乡村的魅力。</li><li>演出：通过演出乡村的传统音乐、舞蹈、戏曲等，让人们欣赏和体验乡村的艺术魅力，增强乡村文化的认同感和自豪感。</li><li>体验：通过让人们参与乡村的传统手工艺制作、农耕文化体验等，让人们亲身体验乡村生活的乐趣和艰辛，加深对乡村文化的了解和认识。</li></ol><p>总的来说，乡村记忆活动是一种有益的文化活动，可以促进乡村旅游和文化传承，推动乡村经济的发展和文化的交流。如果您想了解更多关于乡村记忆活动的信息，可以咨询当地的文化部门或旅游部门。</p>\",\"communityIds\":[2,1],\"createBy\":\"18888888888\",\"endTime\":\"2024-02-07 00:00:00\",\"estateId\":1,\"headlineId\":3,\"headlineTitle\":\"乡村记忆\",\"headlineUrl\":\"http://file.community.szcjzhxq.com/statics/2024/01/30/JDEshangyeguanli_20240130175507A192.png\",\"startTime\":\"2024-01-31 00:00:00\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-01-30 17:55:49', 0);
