INSERT INTO `sys_oper_log` VALUES (906, '修改信息公示', 2, 'com.wr.estate.web.info.InvestController.edit()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"尊敬的业主(住户):\",\"communityId\":1,\"content\":\"<p>尊敬的业主(住户):</p><p>大家好!</p><p>20xx年“清明节”即将来临之际，为保障全体业主(住户)度过一个安全、安心的节日，特提醒全体业主</p><p>(住户)做好以下居家安全防范:</p><p>1、为了保持小区环境整洁，严禁在小区内焚烧纸钱、香蜡等物品，如需焚烧纸钱请前往指定的地点:。</p><p>2、切勿在小区楼道、走廊、草坪、燃气管道旁、高压线下、化粪池边等公共区域及危险区域焚烧香纸</p><p>3、如您出远门，请及时关闭水、电、气阀门及门窗，注意家中水电气的使用安全，防范火灾和天然气泄露;</p><p>4、驾车进入小区停车场以后，请随手关好门窗、车灯;请将车辆正确停放在车位上，停车时勿占用公共通道、勿堵塞消防通道、不斜停、不一车占两位、停车前先下客再入位，叮嘱车内乘客小心开门避免擦碰:</p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-02-20 14:28:59\",\"estateId\":1,\"estateName\":\"宣城市城建物业服务有限公司\",\"investId\":11,\"investStatus\":\"0\",\"investTitle\":\"节日通告提醒\",\"investType\":\"1\",\"readNum\":5,\"updateBy\":\"18888888888\",\"updateTime\":\"2024-02-20 14:28:59\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-21 14:13:23', 0);
