INSERT INTO `sys_oper_log` VALUES (910, '修改信息公示', 2, 'com.wr.estate.web.info.InvestController.edit()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"招商依据 根据《中铁集团有限公司物业租赁管理办法要求》，中铁集团有限公司拟对****物业进行公开招商\",\"communityId\":1,\"content\":\"<p>本次招标要求投标人须具有独立法人资格，营业执照经营范围须包含物业管理，并在人员、设备、资金等方面具有相应的服务能力，其中，投标人拟派项目负责人(项目经理)应当具有物业经理上岗证或物业管理师职业资格。</p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-02-20 14:25:52\",\"estateId\":1,\"estateName\":\"宣城市城建物业服务有限公司\",\"investId\":10,\"investStatus\":\"0\",\"investTitle\":\"城建·彩金湖畔 物业招商公告\",\"investType\":\"0\",\"readNum\":11,\"updateBy\":\"18888888888\",\"updateTime\":\"2024-02-20 14:25:52\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-21 14:25:33', 0);
INSERT INTO `sys_oper_log` VALUES (911, '修改信息公示', 2, 'com.wr.estate.web.info.InvestController.edit()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"招商依据 根据《中铁集团有限公司物业租赁管理办法要求》，中铁集团有限公司拟对****物业进行公开招商\",\"communityId\":1,\"content\":\"<p><img src=\\\"http://file.community.szcjzhxq.com/statics/2024/02/21/WechatIMG525_20240221142546A357.jpg\\\"></p><p><strong style=\\\"color: rgb(0, 102, 204);\\\">一、招商依据</strong></p><p>\\t根据《中铁集团有限公司物业租赁管理办法要求》，中铁集团有限公司拟对长沙市人民中路817号物业进行公开招商。 </p><p><strong style=\\\"color: rgb(0, 102, 204);\\\">二、招商物业概况 </strong></p><p>\\t央企物业，整栋房屋面积约7600平方米，共六层:房屋前后有效空用场地面积约4200平方米。物业地处湖南长沙高桥大市场和长沙火车站两大商圈交汇处，附近有地铁、公交多条线路及长株潭城际锦泰站、长沙火车站交通极为便利</p><p><strong style=\\\"color: rgb(0, 102, 204);\\\"> 三、意向承租人资格要求</strong> </p><p>1.在中华人民共和国境内合法注册的独立法人。</p><p>2.承租人有先进经营理念，良好经营实力和丰富</p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-02-20 14:25:52\",\"estateId\":1,\"estateName\":\"宣城市城建物业服务有限公司\",\"investId\":10,\"investStatus\":\"0\",\"investTitle\":\"城建·彩金湖畔 物业招商公告\",\"investType\":\"0\",\"readNum\":11,\"updateBy\":\"18888888888\",\"updateTime\":\"2024-02-20 14:25:52\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-21 14:27:19', 0);
