INSERT INTO `sys_oper_log` VALUES (930, '党员活动', 2, 'com.wr.govern.web.memberact.MemberActController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/memberAct/add', '172.16.200.234', '', '{\"actTheme\":\"党员活动日\",\"address\":\"小区内部\",\"communityId\":1,\"content\":\"1、科学发展教育。组织党员学习党中央以及各级的工作决策和部署、相关会议精神等，让思想始终持续高度一致。学习马列主义、毛泽东思想、邓小平理论和“三个代表”重要思想，学习实践科学发展发观和创先争优等;学习党的基本知识;传达学习党内文件、学习时事政治。\\n2、党风党纪教育。学习《党章》、《中国共产党纪律处分条例》和《中国共产党党员领导干部廉洁从政若干准则》，增强党风党纪教育的针对性和时效性，使党员干部真正\",\"createBy\":\"15788888888\",\"endTime\":\"2024-02-22 00:00:00\",\"params\":{},\"pictureUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/21/11_20240221151016A376.png\",\"planStatus\":\"0\",\"startEndTime\":[\"2024-02-21 00:00:00\",\"2024-02-22 00:00:00\"],\"startTime\":\"2024-02-21 00:00:00\",\"status\":\"0\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-21 15:10:18', 0);
