INSERT INTO `sys_oper_log` VALUES (933, '活动新增', 1, 'com.wr.estate.web.activity.ActiviteManageController.insert()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/activiteCom/manage/insert', '172.16.205.10', '', '{\"actAmount\":1,\"actIntro\":\"<p>活动目的:</p><p><br></p>\",\"actRang\":\"0\",\"actUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/21/1_20240221160433A383.png\",\"activityId\":13,\"activityName\":\"努力践行·乐于奉献·快乐成长\",\"address\":\"小区内部\",\"buildingIds\":[],\"closeTime\":\"2024-02-20 00:00:00\",\"communityId\":1,\"createBy\":\"18888888888\",\"endTime\":\"2024-02-23 00:00:00\",\"estateId\":1,\"startTime\":\"2024-02-21 00:00:00\"}', '{\"msg\":\"添加成功!\",\"code\":200}', 0, NULL, '2024-02-21 16:08:16', 0);
INSERT INTO `sys_oper_log` VALUES (934, '活动新增', 1, 'com.wr.estate.web.activity.ActiviteManageController.insert()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/activiteCom/manage/insert', '172.16.205.10', '', '{\"actAmount\":1,\"actIntro\":\"<p>一、活动主题</p><p>共建生态文明，共享绿色未来</p><p>二、活动目的</p><p>在学习“雷锋月”到来之际，为了发扬雷锋精神，强化文明意识，创造绿色和谐环境，共建生态文明，社区志愿者开展进入南湖公园捡垃圾的志愿活动。通过此次活动可以帮助大家对立更强的环保意识，同时也可以让广大市民了解环保的.重要性，并积极倡导人们要从自身做起，爱护坏境。</p><p>三、活动时间</p><p>2024年2月22日(星期三)</p><p>四、活动地点</p><p>南湖公园</p><p>五、活动对象</p><p>本社区志愿者</p><p>六、活动前期准备</p><p>1、熟悉南湖公园的内部线路</p><p>2、每名志愿者自行带1-2个垃圾袋和一次性手套</p>\",\"actRang\":\"1\",\"actUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/21/2_20240221162315A387.png\",\"activityId\":16,\"activityName\":\"共建生态文明，共享绿色未来\",\"address\":\"小区内部\",\"buildingId\":1,\"buildingIds\":[1],\"closeTime\":\"2024-02-20 00:00:00\",\"communityId\":1,\"createBy\":\"18888888888\",\"endTime\":\"2024-02-29 00:00:00\",\"estateId\":1,\"startTime\":\"2024-02-22 00:00:00\"}', '{\"msg\":\"添加成功!\",\"code\":200}', 0, NULL, '2024-02-21 16:26:50', 0);
INSERT INTO `sys_oper_log` VALUES (935, '活动新增', 1, 'com.wr.estate.web.activity.ActiviteManageController.insert()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/activiteCom/manage/insert', '172.16.205.10', '', '{\"actAmount\":1,\"actIntro\":\"<p>活动背景</p><p>为弘扬中华民族扶贫济困的传统美德，提高全民慈善理念，2024年爱心助学会第18届慈善义演是进一步营造全民慈善的良好氛围，弘扬慈善文化，倡导奉献爱心，本次晚会是慈善与本土文化的完美结合以“爱心传递，真情助学”为主题的义演将在东方红广场举办。</p><p>活动目的、意义</p><p>开展以“爱心传递，真情助学”为主题的慈善义演活动，是为了引导更多的市民关注焦作贫困学生，关注我们身边的弱势群体，我们真诚希望社会各界人士尽自己一份小小的心意，俗话讲滴水能汇成大海，只要人人献出一份爱，这世界将变的更美好!</p><p>以义演方式倡导市民关注我们身边的贫困学生，通过义演活动唤起全社会对慈善事业理解、尊重关心与帮助，扩大慈善事业的影响力。倡导“奉献、友爱、互助、进步”的义工精神。</p>\",\"actRang\":\"0\",\"actUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/21/5_20240221162830A388.png\",\"activityId\":17,\"activityName\":\"爱心传递，真情助学\",\"address\":\"小区内部\",\"buildingIds\":[],\"closeTime\":\"2024-02-20 00:00:00\",\"communityId\":1,\"createBy\":\"18888888888\",\"endTime\":\"2024-02-25 00:00:00\",\"estateId\":1,\"startTime\":\"2024-02-22 00:00:00\"}', '{\"msg\":\"添加成功!\",\"code\":200}', 0, NULL, '2024-02-21 16:29:38', 0);
