INSERT INTO `sys_oper_log` VALUES (1072, '修改防控信息', 2, 'com.wr.govern.web.security.PreventController.updatePrevent()', 'PUT', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1,2],\"content\":\"<p>对于日常比较常见的疾病，我们需要掌握一些常识，尤其是预防的方式，因为很多疾病之所以出现，就是我们在生活中忽视了预防，或者是因为没有正确的进行预防，尤其是像流感这样的色害性较大的疾病，那么关于流感的预防知识，下面就来为大家进行具体介绍。</p><p>如何预防流感</p><p>流感病毒虽然能在人与人之间传染，但它本身很脆弱，并不可怕。流感病毒对各种消毒液都很敏感，如75%的酒精、1%的碘伏等均可在30分钟内灭活。对热和紫外线也很敏感，通常56度情况下30分钟就可杀灭。所以，在流感流行季节，我们做好预防措施可以减少感染机会。以下五</p><p>点是我们要知道的。</p><p>1.不把病毒带回家。</p><p>2.室内通风，不让病毒留在家中。</p><p>3.个人卫生习惯也很重要。</p><p>4.不让宝宝有机会接触病毒。</p><p>5.学会咳嗽礼仪。</p><p>6.抗病毒药物预防</p><p>7.中医预防</p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-02-06 13:47:23\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/06/be6d1cc35352cebcab995cf016eb47c1_20240206134702A287.jpeg\",\"params\":{},\"preventId\":6,\"preventTitle\":\"预防流感\",\"updateBy\":\"15788888888\",\"updateTime\":\"2024-02-06 13:47:23\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-29 10:34:16', 0);
