INSERT INTO `sys_oper_log` VALUES (1095, '修改防控信息', 2, 'com.wr.estate.web.security.PreventController.updatePrevent()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"中国疾控中心发布最新提示\",\"communityId\":1,\"content\":\"<p>新春佳节将至，假期前后人群流动性增加，返乡、探亲访友和外出旅行的人员将明显增多。中国疾病预防控制中心温馨提示:</p><p>(1)保持良好的个人防护习惯，勤洗手，科学佩戴口罩。建议乘坐飞机、火车、长途车、轮船、地铁、公交车等公共交通工具时佩戴口量;老年人、慢性基础疾病患者、孕妇等前往室内公共场所时要佩戴口量。</p><p>(2)倡导有发热、咳嗽等呼吸道症状人员避免参加集体活动或前往人群密集场所，及时就医，就医过程中全程佩戴口量。</p><p>(3)老年人、慢性基础疾病患者等重症高风险人群积极主动接种含XBB变异株抗原成分的新冠病毒疫苗。</p>\",\"createBy\":\"15788888888\",\"createTime\":\"2024-02-29 10:24:29\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/29/防控信息1_20240229102337A737.png\",\"preventId\":8,\"preventTitle\":\"中国疾控中心发布最新提示\",\"preventTypeId\":\"1746864257718894593\",\"updateBy\":\"18888888888\",\"updateTime\":\"2024-02-29 10:24:45\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-29 17:46:04', 0);
INSERT INTO `sys_oper_log` VALUES (1096, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p>社会治安综合治理，是在党委、政府统一领导下，在充分发挥政法部门特别是公安机关骨干作用的同时，组织和依靠各部门、各单位和人民群众的力量，综合运用政治的、经济的、行政的、法律的、文化的、教育的等多种手段，通过加强打击、防范、教育、管理、建设、改造等方面的工作，实现从根本上预防和治理违法犯罪，化解不安定因素，维护社会治安持续稳定的一项系统工程。</p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/29/治安防控1png_20240229174829A773.png\",\"preventId\":14,\"preventTitle\":\"社会治安综合治理是什么?\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-29 17:48:42', 0);
INSERT INTO `sys_oper_log` VALUES (1097, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p>社会治安综合治理的工作范围，主要包括“打击、防范、教育、管理、建设、改造六个方面:</p><p>(一)打击是社会治安综合治理的首要环节，是落实社会治安综合治理其他措施的前提条件。必须长期坚持依法从重从快严厉打击严重刑事犯罪活动的方针，运用打击的手段震慑犯罪分子。</p><p>(二)防范工作是减少各种违法犯罪活动和维护社会治安秩序的积极措施。各单位要在党政的统一领导下，发动群众建立起各种形式的群防群治组织，落实治安责任制，建立健全各项规章制度，不断提高自防自卫的能力。</p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/29/治安防控2_20240229174947A774.png\",\"preventId\":15,\"preventTitle\":\"社会治安综合治理的工作范围有哪些?\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-29 17:50:04', 0);
INSERT INTO `sys_oper_log` VALUES (1098, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p>\'两抢一盗“是指抢劫、抢夺、盗窃(包括入室盗窃和盗窃机动车)等三类多发性侵财案件。</p><p>综治方针:“打防并举、预防为主、专群结合、依靠群众”，全民动员、全警参与、全力以赴，深入开展打击防范“两抢一盗\\\"的犯罪活动，认真解决事关人民群众切身利益的突出治安问题，营造良好的社会生活环境。</p><p>温馨提(安全第一预防为主)</p><p>如何防”两抢\\\"?</p><p>▲外出时，应选择治安环境好的路线,尽量避免在偏僻或昏暗的路段上独身行走</p><p>▲走在人行道上时，不要靠近行车道，提包、手机放在身体右侧。同时留意过往摩托车及周围可疑人员，当摩托车从背后驶来，应有所警觉。</p><p>▲在银行取款时，观察四周是否被盯梢，尽量结伴而行，相互照应。</p><p>▲不要露财。飞车抢夺的目标多为外露的财物，市民外出最好不要将手机放在腰间或胸前，不要边走边打手机，不要将挎包放在自行车篮里。</p><p>▲看到可疑的人，要尽量远离他们。如果被盯上，要往人多的地方走，或报警(向警察)求助或打电话让亲朋好友来接你。</p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/02/29/治安防控3_20240229175440A775.png\",\"preventId\":16,\"preventTitle\":\"社会治安防范小知识\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-02-29 17:55:01', 0);
