INSERT INTO `sys_oper_log` VALUES (1588, '党员活动', 2, 'com.wr.govern.web.memberact.MemberActController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/memberAct/add', '172.16.200.234', '', '{\"actTheme\":\"暖意久长在，送福温情年\",\"address\":\"彩金湖畔\",\"communityId\":1,\"content\":\"为关爱国企退休职工生活，加快国企退休党员融入社区生活，增强党组织归属感，确保国企退休老党员坚定理想信念，学党史、跟党走、感党恩社区党总支开展慰问国企退休职工活动，为他们送去党组织的关爱，并致以节日的问候与祝福。\\n此次慰问，使国企退休党员进一步感受到党组织的关心和温暖。国企退休职工们纷纷表示会积极参加社区组织的活动，继续发挥余热，为辖区发展增砖添瓦，做出自己应有的贡献。\\n\",\"createBy\":\"15788888888\",\"endTime\":\"2024-03-14 00:00:00\",\"pictureUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/12/党员活动1_20240312163447A033.png\",\"planStatus\":\"0\",\"startEndTime\":[\"2024-03-13 00:00:00\",\"2024-03-14 00:00:00\"],\"startTime\":\"2024-03-13 00:00:00\",\"status\":\"0\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-12 16:35:09', 0);
