INSERT INTO `sys_oper_log` VALUES (1590, '党员活动', 2, 'com.wr.govern.web.memberact.MemberActController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/memberAct/add', '172.16.200.234', '', '{\"actTheme\":\"幸福家园大家谈 居民议事解困难\",\"address\":\"彩金湖畔\",\"communityId\":1,\"content\":\"为推进党建引领社区“幸福家园合伙人“建设，突出群众主体地位，本社区积极倡导\\\"和谐邻里，幸福华电\\\"理念，以“家园议事会\\\"此次会议，进一步激发了各位楼长参与小区基层治理工作的积极性和主动性，各位楼长纷纷表示将义不容辞肩负起职责和使命，推动\\\"暖心志愿服务队\\\"的工作在新的一年里再上一个台阶。楼长代表牛阿姨也表示:\\\"我既是一名党员，也是楼长，更应该在社区内发光发热，为社区的安定和发展贡献自己的一份力量。\",\"createBy\":\"15788888888\",\"endTime\":\"2024-03-28 00:00:00\",\"pictureUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/12/党员活动2_20240312164142A034.png\",\"planStatus\":\"1\",\"startEndTime\":[\"2024-03-27 00:00:00\",\"2024-03-28 00:00:00\"],\"startTime\":\"2024-03-27 00:00:00\",\"status\":\"0\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-12 16:41:44', 0);
