INSERT INTO `sys_oper_log` VALUES (1600, '党员活动', 2, 'com.wr.govern.web.memberact.MemberActController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/memberAct/add', '172.16.200.234', '', '{\"actTheme\":\"学·在幸福家园\",\"address\":\"彩金湖畔\",\"communityId\":1,\"content\":\"为切实推进“学习强国“学习平台的广泛应用，充分发挥\\\"学习强国\\\"学习平台的优质资源和强大功能。本社区党支部组织开展“我与学习强国\\\"主题宣讲活动，为辖区群众送上了丰富的精神食粮，不断扩大\\\"学习强国\\\"学习平台的覆盖面和影响力。共有22名党员群众线下参加活动。活动中，本社区党建工作人员将\\\"学习强国\\\"平台上的优质内容融入宣讲环节，选取与群众生产生活密切相关的内容展开宣讲，结合村实际把党的理论思想、方针政策\\\"\",\"createBy\":\"15788888888\",\"endTime\":\"2024-03-16 00:00:00\",\"pictureUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/12/党员活动3_20240312171424A035.png\",\"planStatus\":\"0\",\"startEndTime\":[\"2024-03-15 00:00:00\",\"2024-03-16 00:00:00\"],\"startTime\":\"2024-03-15 00:00:00\",\"status\":\"0\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-12 17:14:59', 0);
