INSERT INTO `sys_oper_log` VALUES (1642, '修改防控信息', 2, 'com.wr.estate.web.security.PreventController.updatePrevent()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"切实提升人民群众安全感、满意度;陕西公安构建立体式巡逻防控网 快速打击处置违法犯罪行为\",\"communityId\":1,\"content\":\"<p><img src=\\\"http://file.community.szcjzhxq.com/statics/2024/03/05/3_20240305203601A919.png\\\"></p><p><strong class=\\\"ql-size-small\\\" style=\\\"color: rgb(230, 0, 0);\\\">切实提升</strong><span class=\\\"ql-size-small\\\">人民群众安全感、满意度;陕西公安构建立体式巡逻防控网 快速打击处置违法犯罪行为</span></p>\",\"createBy\":\"15788888888\",\"createTime\":\"2024-02-29 10:28:21\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/13/防控信息2_20240313151933A088.png\",\"preventId\":9,\"preventTitle\":\"夏季治安打击整治行动\",\"preventTypeId\":\"1746864283518058497\",\"updateBy\":\"18888888888\",\"updateTime\":\"2024-03-05 20:36:53\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-13 15:19:34', 0);
INSERT INTO `sys_oper_log` VALUES (1643, '修改防控信息', 2, 'com.wr.estate.web.security.PreventController.updatePrevent()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"中国疾控中心发布最新提示\",\"communityId\":1,\"content\":\"<p>新春佳节将至，假期前后人群流动性增加，返乡、探亲访友和外出旅行的人员将明显增多。中国疾病预防控制中心温馨提示:</p><p>(1)保持良好的个人防护习惯，勤洗手，科学佩戴口罩。建议乘坐飞机、火车、长途车、轮船、地铁、公交车等公共交通工具时佩戴口量;老年人、慢性基础疾病患者、孕妇等前往室内公共场所时要佩戴口量。</p><p>(2)倡导有发热、咳嗽等呼吸道症状人员避免参加集体活动或前往人群密集场所，及时就医，就医过程中全程佩戴口量。</p><p>(3)老年人、慢性基础疾病患者等重症高风险人群积极主动接种含XBB变异株抗原成分的新冠病毒疫苗。</p>\",\"createBy\":\"15788888888\",\"createTime\":\"2024-02-29 10:24:29\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/13/防控信息1_20240313151944A089.png\",\"preventId\":8,\"preventTitle\":\"中国疾控中心发布最新提示\",\"preventTypeId\":\"1746864257718894593\",\"updateBy\":\"18888888888\",\"updateTime\":\"2024-02-29 17:46:04\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-13 15:19:46', 0);
INSERT INTO `sys_oper_log` VALUES (1644, '修改防控信息', 2, 'com.wr.estate.web.security.PreventController.updatePrevent()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"阎良公安：织密岁末“防控网” 守好年终“安全关”\",\"communityId\":1,\"content\":\"<p class=\\\"ql-align-justify\\\">阎良公安 守好年终“安全关”</p><p class=\\\"ql-align-justify\\\">年关将至，为进一步营造祥和的社会环境，加强岁末年初街面巡逻防控力度，公安阎良分局针对春节前夕街面人、财、物流动性大，传统盗窃案件、电信诈骗案件等发案特点，结合辖区治安特点，提高街面见警率、管事率</p><p><img src=\\\"http://file.community.szcjzhxq.com/statics/2024/03/13/治安防控1_20240313152117A091.png\\\"></p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-01-23 14:35:47\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/13/治安防控1_20240313152107A090.png\",\"preventId\":5,\"preventTitle\":\"阎良公安：织密岁末“防控网” 守好年终“安全关”\",\"preventTypeId\":\"1746864158309695490\",\"updateBy\":\"18888888888\",\"updateTime\":\"2024-01-25 10:43:16\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-13 15:21:19', 0);
INSERT INTO `sys_oper_log` VALUES (1645, '修改防控信息', 2, 'com.wr.govern.web.security.PreventController.updatePrevent()', 'PUT', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p>社会治安综合治理的工作范围，主要包括“打击、防范、教育、管理、建设、改造六个方面:</p><p>(一)打击是社会治安综合治理的首要环节，是落实社会治安综合治理其他措施的前提条件。必须长期坚持依法从重从快严厉打击严重刑事犯罪活动的方针，运用打击的手段震慑犯罪分子。</p><p>(二)防范工作是减少各种违法犯罪活动和维护社会治安秩序的积极措施。各单位要在党政的统一领导下，发动群众建立起各种形式的群防群治组织，落实治安责任制，建立健全各项规章制度，不断提高自防自卫的能力。</p>\",\"createBy\":\"15788888888\",\"createTime\":\"2024-02-29 17:50:04\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/13/防控信息1_20240313152419A093.png\",\"preventId\":15,\"preventTitle\":\"社会治安综合治理的工作范围有哪些?\",\"preventTypeId\":\"治安防控\",\"updateBy\":\"15788888888\",\"updateTime\":\"2024-02-29 17:50:04\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-13 15:24:20', 0);
INSERT INTO `sys_oper_log` VALUES (1646, '修改防控信息', 2, 'com.wr.govern.web.security.PreventController.updatePrevent()', 'PUT', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p>社会治安综合治理，是在党委、政府统一领导下，在充分发挥政法部门特别是公安机关骨干作用的同时，组织和依靠各部门、各单位和人民群众的力量，综合运用政治的、经济的、行政的、法律的、文化的、教育的等多种手段，通过加强打击、防范、教育、管理、建设、改造等方面的工作，实现从根本上预防和治理违法犯罪，化解不安定因素，维护社会治安持续稳定的一项系统工程。</p>\",\"createBy\":\"15788888888\",\"createTime\":\"2024-02-29 17:48:42\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/13/治安防控3_20240313152528A094.png\",\"preventId\":14,\"preventTitle\":\"社会治安综合治理是什么?\",\"preventTypeId\":\"治安防控\",\"updateBy\":\"15788888888\",\"updateTime\":\"2024-02-29 17:48:42\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-13 15:25:30', 0);
