INSERT INTO `sys_oper_log` VALUES (1882, '修改信息公示', 2, 'com.wr.estate.web.info.InvestController.edit()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"安徽网、大皖客户端讯 今天上午，春节假期后的上班第一天，宣城市召开全市工业强市暨招商引资推进大会。大会为中鼎集团董事长夏鼎湖、宣酒集团董事长李健等20名宣城市功勋企业家颁奖，另有50家企业获颁2018年度宣城市明星工业企业称号。\",\"communityId\":1,\"content\":\"<p><img src=\\\"http://file.community.szcjzhxq.com/statics/2024/03/17/WechatIMG4828_20240317163413A316.jpg\\\">\\t</p><p>\\t<span style=\\\"color: rgb(51, 51, 51);\\\">安徽网、大皖客户端讯 今天上午，春节假期后的上班第一天，宣城市召开全市工业强市暨招商引资推进大会。大会为中鼎集团董事长夏鼎湖、宣酒集团董事长李健等20名宣城市功勋企业家颁奖，另有50家企业获颁2018年度宣城市明星工业企业称号。</span></p><p>\\t<span style=\\\"color: rgb(51, 51, 51);\\\">此外，大会上还向10名2018年度市直招商引资先进个人和5家获得2017年度市长质量奖企业颁奖。</span></p><p><br></p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-01-31 08:59:57\",\"estateId\":1,\"estateName\":\"宣城市城建物业服务有限公司\",\"investId\":8,\"investStatus\":\"0\",\"investTitle\":\"宣城市为招商引资先进个人颁奖\",\"investType\":\"0\",\"readNum\":46,\"updateBy\":\"18888888888\",\"updateTime\":\"2024-01-31 08:59:57\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-17 16:34:18', 0);
