INSERT INTO `sys_oper_log` VALUES (1958, '活动新增', 1, 'com.wr.estate.web.activity.ActiviteManageController.insert()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/activiteCom/manage/insert', '172.16.205.10', '', '{\"actAmount\":120,\"actIntro\":\"<p>\\t为大力弘扬雷锋精神和志愿服务精神，近日，中建八局轨道公司南京地铁9号线项目团支部志愿者积极参与“建证未来·益路同行”青年志愿主题活动启动暨服务社区文明有礼公益行动。</p><p class=\\\"ql-align-center\\\"><img src=\\\"https://jcdn.xhby.net/dams-res/editing/image/202403/20/65fa8beee4b08405abe703f2.png?image_process=resize,w_800/format,jpg\\\"></p><p>\\t在会议现场，中建八局轨道公司代表宣读青年志愿服务书倡议。现场志愿活动中，南京地铁9号线盾构项目的志愿者积极为社区居民宣讲消防安全知识、讲解灭火器用法，结合日常消防管理工作实际，密切关注群众需求，并综合本市近期电动车火灾、燃气爆炸等事故情况，认真研究志愿服务内容，精心设计服务环节，统筹协调服务资源，为尧化街道群众现场提供场景式体验教学和应急科普宣传等志愿服务活动。</p><p><br></p>\",\"actRang\":\"0\",\"actUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/20/WechatIMG679_20240320174340A668.jpg\",\"activityId\":36,\"activityName\":\"“建证未来”志愿服务队开展消防安全知识进\",\"address\":\"小区门口\",\"buildingIds\":[],\"closeTime\":\"2024-03-20 17:44:08\",\"communityId\":2,\"createBy\":\"18888888888\",\"endTime\":\"2024-03-31 00:00:00\",\"estateId\":1,\"startTime\":\"2024-03-20 19:43:43\"}', '{\"msg\":\"添加成功!\",\"code\":200}', 0, NULL, '2024-03-20 17:44:50', 0);
