INSERT INTO `sys_oper_log` VALUES (2027, '党员活动', 2, 'com.wr.govern.web.memberact.MemberActController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/memberAct/add', '172.16.200.234', '', '{\"actTheme\":\"弘扬党的先进作风，完善支部组织建设\",\"address\":\"彩金湖畔广场\",\"communityId\":1,\"content\":\"(一)阅读健康，富有内涵的课外书籍，增强大家的知识面，并且陶冶各自的情操。\\n(二)展现当代大学生良好的精神风貌和优秀的品格，不仅仅在学术上要争优，更要在实践中锻炼自己，勇创先进,贡献自己的一份力量。\\n(三)为使各党员继承和发扬五四运动的光荣传统，大力弘扬爱国、科学、民主、进步的“五四”精神，培养和展示党员的人文素质，不断增强党员的光茉感、责任感和使命感。\",\"createBy\":\"15788888888\",\"endTime\":\"2024-04-29 00:00:00\",\"pictureUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/034cc93918bebd1389d4765aab7085f1_20240322151107A775.jpeg\",\"planStatus\":\"0\",\"startEndTime\":[\"2024-03-22 00:00:00\",\"2024-04-29 00:00:00\"],\"startTime\":\"2024-03-22 00:00:00\",\"status\":\"0\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:11:09', 0);
