INSERT INTO `sys_oper_log` VALUES (2041, '新增党建调研', 1, 'com.wr.govern.web.autonomy.research.ResearchController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/research/add', '172.16.200.234', '', '{\"community\":1,\"communityIds\":4,\"createBy\":\"15788888888\",\"deadlineTime\":\"2024-03-23 15:40:42\",\"multiple\":[{\"itemValue\":[{\"value\":\"引领\"},{\"value\":\"超越\"},{\"value\":\"和谐\"}],\"title\":\"对党有什么样的理解\"}],\"researchId\":11,\"researchIntro\":\"创新基层党建工作思路和模式 完善党的基层组织体系丨区领导调研基层党建工作\",\"researchName\":\"创新基层党建工作思路和模式\",\"researchStatus\":\"0\",\"single\":[{\"itemValue\":[{\"value\":\"大学\"},{\"value\":\"社会\"}],\"title\":\"什么时候入党\"}],\"text\":[{\"itemValue\":[{\"value\":\"\"}],\"title\":\"描述一下入党之后的变化\"}]}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:42:21', 0);
INSERT INTO `sys_oper_log` VALUES (2042, '活动新增', 1, 'com.wr.estate.web.activity.ActiviteManageController.insert()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/activiteCom/manage/insert', '172.16.205.10', '', '{\"actAmount\":0,\"actIntro\":\"<p>11月18日，在社区党委的支持下，社区联合社会工作服务中\'驻点社工、深发展服务中心开展指南针科普活动，20余名儿童青少年参与“探秘”</p><p>\\\"指南针是我国古代四大发明之一，由我国传到世界各地。战国时期，我国人民利用磁石能指示南北的特性，制成了\'司南’经过不断发展，形成了现在的指南针。\\\"老师的讲解加深了孩子对指南针这项发明的认识。</p><p><img src=\\\"http://file.community.szcjzhxq.com/statics/2024/03/22/社区活动7_20240322154528A808.png\\\"></p><p>随后，老师讲解了简易指南针模型的制作方法，孩子们跟随着老师的步骤，开始动手制作起来，很快一个个精致的指南针模型展现在大家面前。</p><p>“此次科普活动让孩子在实践中体验到了中华文化的魅力，同时，也进一步激发了大家对科学的喜爱，非常有意义。”一名陪同家长说。</p>\",\"actRang\":\"0\",\"actUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/社区活动7_20240322154512A807.png\",\"activityId\":41,\"activityName\":\"《中国古代四大发明之指南针》 科普活动\",\"address\":\"彩金湖畔\",\"buildingIds\":[],\"closeTime\":\"2024-03-22 00:00:00\",\"communityId\":1,\"createBy\":\"18888888888\",\"endTime\":\"2024-03-24 00:00:00\",\"estateId\":1,\"startTime\":\"2024-03-23 00:00:00\"}', '{\"msg\":\"添加成功!\",\"code\":200}', 0, NULL, '2024-03-22 15:45:30', 0);
INSERT INTO `sys_oper_log` VALUES (2043, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p class=\\\"ql-align-justify\\\">流感是一种高度传染性的病毒性疾病，其预防措施对于保护个人和社区的健康至关重要。在流感期间可以采取的预防措施，有加强病情监测、疫苗接种、注意个人卫生，以及室内通风、增强免疫力等。</p><p class=\\\"ql-align-justify\\\">1、加强病情监测：通过及时发现和报告流感病例，可以有效地控制流感的传播。在公共场所和集体单位，加强卫生管理，如经常洗手、戴口罩等，可以减少病毒的传播。</p><p class=\\\"ql-align-justify\\\">2、疫苗接种：疫苗接种是预防流感的最重要措施之一，流感疫苗每年都会更新，以适应当前流行的病毒。疫苗接种可以显著降低患流感的风险，并减轻病情严重程度。</p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/Mask group@3x_20240322154908A809.png\",\"preventId\":19,\"preventTitle\":\"预防流感，保护自己和他人\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:50:27', 0);
INSERT INTO `sys_oper_log` VALUES (2044, '修改防控信息', 2, 'com.wr.govern.web.security.PreventController.updatePrevent()', 'PUT', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p class=\\\"ql-align-justify\\\">流感是一种高度传染性的病毒性疾病，其预防措施对于保护个人和社区的健康至关重要。在流感期间可以采取的预防措施，有加强病情监测、疫苗接种、注意个人卫生，以及室内通风、增强免疫力等。</p><p class=\\\"ql-align-justify\\\">1、加强病情监测：通过及时发现和报告流感病例，可以有效地控制流感的传播。在公共场所和集体单位，加强卫生管理，如经常洗手、戴口罩等，可以减少病毒的传播。</p><p class=\\\"ql-align-justify\\\">2、疫苗接种：疫苗接种是预防流感的最重要措施之一，流感疫苗每年都会更新，以适应当前流行的病毒。疫苗接种可以显著降低患流感的风险，并减轻病情严重程度。</p>\",\"createBy\":\"15788888888\",\"createTime\":\"2024-03-22 15:50:27\",\"delFlag\":\"0\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/Mask group@3x_20240322154908A809.png\",\"preventId\":19,\"preventTitle\":\"预防流感，保护自己和他人\",\"preventTypeId\":\"治安防控\",\"updateBy\":\"15788888888\",\"updateTime\":\"2024-03-22 15:50:27\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:52:11', 0);
INSERT INTO `sys_oper_log` VALUES (2045, '菜单管理', 2, 'com.wr.system.controller.SysMenuController.edit()', 'PUT', 1, 'xccj_estate_sys.sys_USER', 'system', NULL, '/menu', '172.16.200.234', '', '{\"children\":[],\"component\":\"govern/security/prevent\",\"createTime\":\"2023-08-04 10:12:50\",\"icon\":\"code\",\"isCache\":\"0\",\"isFrame\":\"1\",\"menuId\":1980,\"menuName\":\"治安防控\",\"menuType\":\"C\",\"orderNum\":31,\"parentId\":0,\"path\":\"prevent\",\"perms\":\"\",\"platType\":\"GOVERN\",\"query\":\"\",\"status\":\"0\",\"updateBy\":\"system\",\"visible\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:54:16', 0);
INSERT INTO `sys_oper_log` VALUES (2046, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p><span style=\\\"background-color: rgb(248, 249, 249); color: rgb(51, 51, 51);\\\">为进一步强化社会面管控，确保辖区社会治安局势持续稳定。根据上级部门安排部署，近期，天峻县公安局江河派出所结合辖区社会治安形势和区域特点，高标准、严要求、强措施开展治安巡逻防控工作。</span></p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/WechatIMG701_20240322155557A816.jpg\",\"preventId\":20,\"preventTitle\":\"巡防宣控多措并举 平安相随“警”色正浓\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:56:13', 0);
INSERT INTO `sys_oper_log` VALUES (2047, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[1],\"content\":\"<p><strong style=\\\"color: rgb(51, 51, 51);\\\">警力扼守在街面</strong></p><p>“请帮帮我们，我女朋友被火锅汤底烫伤了！”1月1日23时许，南京市公安局鼓楼分局鼓楼警务工作站民警彭浩正和搭档一起在路面巡逻，警车行至辖区一家火锅店旁边时，一名小伙子前来求助。彭浩立刻和搭档一起将受伤女子送上警车，快速驶往最近的江苏省人民医院。因为抢救及时，没有留下疤痕。</p><p>鼓楼警务工作站位于南京市鼓楼公园南侧、地铁站出口，占地面积约300平方米，辖区面积达5.6平方公里，其中重点高校、重点医院、重点商圈云集，纠纷多、警情多、求助多。</p><p>鼓楼警务工作站拥有独立的正科级建制，配备民警23名、辅警48名。“鼓楼分局的鼓楼和华侨路两个派出所的街面巡逻和警情处置任务，大部分都由我们来承担。”鼓楼警务工作站站长曹佳介绍，自警务工作站成立后，这两个派出所的日常处警量平均减少了三分之二。</p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/WechatIMG702_20240322155812A817.jpg\",\"preventId\":21,\"preventTitle\":\"配置专职民警辅警1万余名，“街头的枫桥”安全感满满！\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 15:58:31', 0);
