INSERT INTO `sys_oper_log` VALUES (2050, '活动新增', 1, 'com.wr.estate.web.activity.ActiviteManageController.insert()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/activiteCom/manage/insert', '172.16.205.10', '', '{\"actAmount\":0,\"actIntro\":\"<p>群众利益无小事，食品安全是大事。12月11日，社区党群服务中心、社会工作服务中心驻点社工开展了以“关注食品安全 建设平安社会”为主题的食品安全宣传活动。</p><p><img src=\\\"http://file.community.szcjzhxq.com/statics/2024/03/22/社区活动13_20240322161646A826.png\\\"></p><p>活动中，志愿者向居民发放了食品安全手册等资料，并邀请居民扫码进行线上食品安全知识问答，现场对居民提出的食品安全问题进行答疑解惑。宣讲内容通俗易懂，切实将食品安全知识融入居民生活</p><p>此次宣传活动，不仅增强了居民对食品安全的认知，还促进了居民对食品安全相关知识的学习。社区将继续开展此类活动服务于广大居民，提高居民的健康水平，营造更加和谐健康的社区氛围。</p>\",\"actRang\":\"0\",\"actUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/社区活动12png_20240322161603A824.png\",\"activityId\":44,\"activityName\":\"食品安全宣传活动\",\"address\":\"lvzy社区\",\"buildingIds\":[],\"closeTime\":\"2024-03-23 00:00:00\",\"communityId\":2,\"createBy\":\"18888888888\",\"endTime\":\"2024-03-25 00:00:00\",\"estateId\":1,\"startTime\":\"2024-03-24 00:00:00\"}', '{\"msg\":\"添加成功!\",\"code\":200}', 0, NULL, '2024-03-22 16:18:03', 0);
