INSERT INTO `sys_oper_log` VALUES (2052, '添加通知公告', 1, 'com.wr.estate.web.info.CommunityNoticeController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/notice', '172.16.205.10', '', '{\"briefIntroduction\":\"紧急停水通知\",\"communityId\":2,\"communityIds\":[],\"content\":\"<p>紧急停水通知</p><p>尊敬的业主/住户您好</p><p>小区 东侧道路附近自来水主管道突然爆管，漏水严重雪要整个小区停水维修。请大家提前储备生活用水。</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"noticeId\":17,\"noticeTitle\":\"紧急停水通知2023年12月22日\",\"range\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 17:59:43', 0);
INSERT INTO `sys_oper_log` VALUES (2053, '添加通知公告', 1, 'com.wr.estate.web.info.CommunityNoticeController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/notice', '172.16.205.10', '', '{\"briefIntroduction\":\"“爱心冬衣暖童心”捐衣(物)扶幼助老活动\",\"communityId\":2,\"communityIds\":[],\"content\":\"<p>寒冬来临，山里有一些孤贫儿童，独孤老人，需要被子，旧衣服等。邻居们家里如果有不需的东西，请大包送给志愿者一玉格格(平安苑6号楼)。如果您有空也可以跟我-起送去山里。</p><p>1类:闲置的小学儿童穿的衣物厚袜子鞋子，帽子围巾手套;</p><p>2类:学习用品，铅笔本子橡皮，彩笔等:</p><p>3类:保温杯，保温饭盒;</p><p>4类:麦片、奶粉、芝麻糊等粉状食物。</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"noticeId\":18,\"noticeTitle\":\"“爱心冬衣暖童心”捐衣(物)扶幼助老活动\",\"range\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 18:14:47', 0);
INSERT INTO `sys_oper_log` VALUES (2054, '修改通知公告', 2, 'com.wr.estate.web.info.CommunityNoticeController.edit()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/notice', '172.16.205.10', '', '{\"briefIntroduction\":\"社区甚至变成了“远近闻名”的外来车辆免费长期停车场，这影响小区美观同时，阻塞消防通道还带来了严重的消防安全隐患\",\"communityId\":2,\"content\":\"<p class=\\\"ql-align-justify\\\">\\t全体业主根据《民法典》《消防法》、《物业管理条例》、《管理规约》，小区公共区域属于全体业主共有，任何单位个人不得长期侵占。随着小区车辆(包括私家车、电动车、自行车)不断增加，小区停车资源极度紧张，而且小区内大量废旧车辆无人维护、落满灰尘、乱停乱放，挤占了有限的车棚停车位、消防通道等公共空间，社区甚至变成了“远近闻名”的外来车辆免费长期停车场，这影响小区美观同时，阻塞消防通道还带来了严重的消防安全隐患。新年将至，为充分利用小区公共区域，杜绝消防安全隐患，切实保障平安苑真实业主的权益，业主委员会将联合物业公司、社区城管对小区非机动车棚，路边、停车场楼道等公共区域的“僵尸车”进行集中清理。</p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-03-22 17:44:01\",\"estateId\":1,\"estateName\":\"宣城市城建物业服务有限公司\",\"noticeId\":14,\"noticeStatus\":\"0\",\"noticeTitle\":\"lvzy社区集中清理”僵尸车”的通知\",\"range\":\"0\",\"readNum\":0,\"updateBy\":\"18888888888\",\"updateTime\":\"2024-03-22 17:44:01\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 18:19:19', 0);
INSERT INTO `sys_oper_log` VALUES (2055, '修改通知公告', 2, 'com.wr.estate.web.info.CommunityNoticeController.edit()', 'PUT', 1, 'ESTATE_USER', '18888888888', NULL, '/notice', '172.16.205.10', '', '{\"briefIntroduction\":\"关于谨慎缴纳物业费的提醒\",\"communityId\":1,\"content\":\"<p>\\t彩金湖畔业委会正在和物业公司谈判物业费打折事项。</p><p>再次提醒务位广大业主，向物业公司缴纳物业费，请注意，注意如下事项:</p><p>1、谨慎预交物业费谨慎预交物业费(尤其明年的)，避免预缴物业费物业不退费而引起不必要的纠纷(不要贪那一颗白菜而因小失大)</p><p>2、务必保留发票等凭证</p><p class=\\\"ql-align-justify\\\">缴纳物业费、水电费等务必保留凭证，要求物业公司开具正规发票(注意是发票，非收据，发票是法律认可的凭证)，对于拒绝开具发票的，涉嫌偷税漏税，可以拒绝支付;</p>\",\"createBy\":\"18888888888\",\"createTime\":\"2024-03-22 17:26:54\",\"estateId\":1,\"estateName\":\"宣城市城建物业服务有限公司\",\"noticeId\":9,\"noticeStatus\":\"0\",\"noticeTitle\":\"关于谨慎缴纳物业费的提醒，谨慎预交费，保留发票凭证\",\"range\":\"0\",\"readNum\":0,\"updateBy\":\"18888888888\",\"updateTime\":\"2024-03-22 17:26:54\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 18:21:52', 0);
