INSERT INTO `sys_oper_log` VALUES (2064, '添加信息公示', 1, 'com.wr.estate.web.info.InvestController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"为了丰富小区居民的业余生活，促进邻里交流\",\"communityId\":1,\"content\":\"<p>尊敬的业主/住户：</p><p>为了丰富小区居民的业余生活，促进邻里交流，我们计划举办以下社区活动，欢迎大家积极参与！</p><ol><li><strong style=\\\"color: initial;\\\">活动名称</strong>：亲子趣味运动会</li></ol><ul><li class=\\\"ql-indent-1\\\">时间：本周日</li><li class=\\\"ql-indent-1\\\">地点：小区运动场</li><li class=\\\"ql-indent-1\\\">内容：各类亲子运动项目，如两人三足、家庭接力赛等。</li></ul><p>具体活动时间和地点可能会根据实际情况进行调整，请留意小区公告栏或社区微信群的通知。同时，我们也欢迎大家提出更多的活动建议，共同打造一个温馨和谐的小区环境。</p><p>感谢大家的支持和配合！</p><p>公示地点：物业管理处</p><p>公示日期：2024.03.20</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"investTitle\":\"彩金湖畔社区活动公示\",\"investType\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 19:00:19', 0);
INSERT INTO `sys_oper_log` VALUES (2065, '添加信息公示', 1, 'com.wr.estate.web.info.InvestController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"关心和关爱小区内的老年居民\",\"communityId\":2,\"content\":\"<p>尊敬的业主/住户：</p><p>为了关心和关爱小区内的老年居民，提高他们的健康意识和生活质量，我们特别举办了一场老年健康讲座。现将相关信息通报如下：</p><ol><li><strong style=\\\"color: initial;\\\">讲座时间</strong>：2024.03.25下午3点</li><li><strong style=\\\"color: initial;\\\">讲座地点</strong>：小区大广场</li><li><strong style=\\\"color: initial;\\\">讲座内容</strong>：</li></ol><ul><li class=\\\"ql-indent-1\\\">常见老年疾病的预防与治疗</li><li class=\\\"ql-indent-1\\\">健康生活方式与营养保健</li><li class=\\\"ql-indent-1\\\">心理健康与压力管理</li><li class=\\\"ql-indent-1\\\">互动问答环节</li></ul><ol><li><strong style=\\\"color: initial;\\\">参与对象</strong>：小区内的老年居民及对健康知识感兴趣的人士</li></ol><p>此次讲座将为大家提供一个学习和交流的平台，希望能帮助老年朋友们更好地了解健康知识，养成良好的生活习惯。同时，也欢迎其他居民踊跃参加。</p><p>如有任何疑问或需要协助，可联系小区物业管理处。</p><p>感谢大家的关注与支持！</p><p>公示地点：物业管理处</p><p>公示日期：2024.03.22</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"investTitle\":\"老年健康讲座通报公示\",\"investType\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 19:03:22', 0);
