INSERT INTO `sys_oper_log` VALUES (2128, '添加防控信息', 1, 'com.wr.estate.web.security.PreventController.addPrevent()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"物业也要做好日常的电动车禁止入户/室内充电的消防宣传\",\"communityId\":2,\"content\":\"<p><span style=\\\"color: rgb(51, 51, 51);\\\">近日，南京一小区电动车起火事故牵动人心，电动车管控刻不容缓。</span></p><p><br></p><p><span style=\\\"color: rgb(51, 51, 51);\\\">物业也要做好日常的电动车禁止入户/室内充电的消防宣传，这些电动车相关的法律法规，还有相关违规罚款条例，物业可以发业主。</span></p><p><span style=\\\"color: rgb(51, 51, 51);\\\">.</span></p><p><span style=\\\"color: rgb(51, 51, 51);\\\">【一】国家应急管理部发布的《高层民用建筑消防安全管理规定》于2021年8月1日已施行！</span></p><p><span style=\\\"color: rgb(51, 51, 51);\\\">【二】《广东省实施〈中华人民共和国消防法〉办法》2022年7月1日起，正式施行！</span></p><p><span style=\\\"color: rgb(51, 51, 51);\\\">【三】深圳新修订《消防条例》于2023年11月1日起实施，加强对于电动自行车、电动摩托车的充电、停放的监管，同时明确处罚。</span></p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/22/2_20240322193411A944.png\",\"preventId\":22,\"preventTitle\":\"物业【电动车禁止入户停放与充电】法律法规\",\"preventTypeId\":\"1746864209115299841\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-22 19:34:12', 0);
