INSERT INTO `sys_oper_log` VALUES (2132, '添加防控信息', 1, 'com.wr.govern.web.security.PreventController.addPrevent()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/prevent', '172.16.200.234', '', '{\"communityIds\":[2],\"content\":\"<p><span style=\\\"color: rgb(0, 0, 0);\\\">近日，宣城市宣州区人民法院“执行110”接到一起民间借贷纠纷案件申请人提供的线索后立即出警，20分钟内快速将在高铁站等待载客的被执行人张某强制拘传回法院，在执行干警刚柔并济地悉心调解下，张某主动缴纳了罚款，并履行了部分案款，余款同申请人达成执行和解，不仅切实维护了申请人的合法权益，而且有力地打击了拒不配合执行行为。</span></p><p><br></p>\",\"createBy\":\"15788888888\",\"estateId\":1,\"imageUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/23/WechatIMG729_20240323123610A971.jpg\",\"preventId\":22,\"preventTitle\":\"【宣法·执行在线】“执行110”接警后 20分钟拘传促履行\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-23 12:37:06', 0);
