INSERT INTO `sys_oper_log` VALUES (2251, '党组织管理', 1, 'com.wr.govern.web.party.PartyController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/party/add', '172.16.200.234', '', '{\"adminId\":103,\"communityId\":2,\"content\":\"党组织是党在社会基层组织中的战斗堡垒，是党的全部工作和战斗力的基础。它主要由党的基层委员会、总支部委员会和支部委员会组成，负责将党的路线方针政策和党中央决策部署贯彻落实好，把各领域广大群众组织凝聚好。\",\"createBy\":\"15788888888\",\"estateId\":1,\"logoUrl\":\"http://file.community.szcjzhxq.com/statics/2024/03/28/党组织_20240328100307A250.png\",\"partyName\":\"党组织管理\",\"partyStatus\":\"0\",\"partyType\":\"6\",\"topId\":4,\"topParty\":\"0\",\"unitCase\":\"1\",\"unitName\":\"lvzy社区党组织\",\"unitType\":\"2\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-28 10:03:08', 0);
INSERT INTO `sys_oper_log` VALUES (2252, '新增党建调研', 1, 'com.wr.govern.web.autonomy.research.ResearchController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/research/add', '172.16.200.234', '', '{\"community\":2,\"communityIds\":7,\"createBy\":\"15788888888\",\"deadlineTime\":\"2024-03-30 00:00:00\",\"multiple\":[{\"itemValue\":[{\"value\":\"加强党员干部的理想信念教育，提高政治觉悟和责任意识。\"},{\"value\":\"强化基层党组织建设，提高组织力和凝聚力，确保党组织在各项工作中的领导核心作用。\"},{\"value\":\"推动党建工作与业务工作深度融合，实现相互促进、共同发展。\"}],\"title\":\"您认为如何加强和改进党建工作？\"}],\"researchId\":15,\"researchIntro\":\"关于党建的调研活动\",\"researchName\":\"党建调研活动\",\"researchStatus\":\"0\",\"single\":[{\"itemValue\":[{\"value\":\"非常满意\"},{\"value\":\"不满意\"},{\"value\":\"一般\"}],\"title\":\"您如何评价当前党的建设工作成效？\"},{\"itemValue\":[{\"value\":\"部分党员干部理想信念不坚定，缺乏责任感和使命感。\"},{\"value\":\"基层党组织建设薄弱，存在组织力不强、作用发挥不明显等问题。\"},{\"value\":\"党建活动形式单一、内容枯燥，缺乏吸引力和实效性。\"}],\"title\":\"您认为当前党建工作中存在哪些问题？\"}],\"text\":[{\"itemValue\":[{\"value\":\"\"}],\"title\":\"请谈谈您对创新党建工作方式的看法和建议。\"}]}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-28 10:12:20', 0);
