INSERT INTO `sys_oper_log` VALUES (2680, '新增', 1, 'com.wr.estate.web.featured.FeaturedSectionController.addSystemSocial()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/featuredSection', '172.16.205.10', '', '{\"communityId\":1,\"communityIds\":[1],\"content\":\"我们一直到都在说，中国书法中国的十大国粹之一，也是优秀的中国传统文化，是中国文化的瑰宝，对于华夏民族来说有着非常重要的地位，我们任何人都为有这文化而感到自豪。\",\"createBy\":\"18888888888\",\"estateId\":1,\"featuredId\":37,\"featuredSectionTypeId\":\"1763543186453651458\",\"featuredUrl\":\"http://file.community.szcjzhxq.com/statics/2024/04/10/书法_20240410154205A481.jpg\",\"userId\":100}', '{\"msg\":\"添加成功\",\"code\":200}', 0, NULL, '2024-04-10 15:42:06', 0);
INSERT INTO `sys_oper_log` VALUES (2681, '新增评论', 1, 'com.wr.estate.web.featured.FeaturedCommentController.addComment()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/featuredComment/addComment', '172.16.205.10', '', '{\"content\":\"首先，我们要知道什么是书法，书法是指按照文字特点和含义，以其书体笔法、结构和章法写字，使之成为富有美感的艺术作品。也就是说书法是一种艺术，不仅仅是写字那么简单，书法作品就是艺术作品，当然了，即使是艺术，也是有优劣好坏之分的。\",\"createBy\":\"18888888888\",\"featuredId\":37,\"replyId\":0,\"userId\":100}', '{\"msg\":\"评论成功\",\"code\":200}', 0, NULL, '2024-04-10 15:50:33', 0);
