INSERT INTO `sys_oper_log` VALUES (3084, '新增', 1, 'com.wr.estate.web.featured.FeaturedSectionController.addSystemSocial()', 'POST', 1, 'ESTATE_USER', '16666666666', NULL, '/featuredSection', '172.16.205.10', '', '{\"communityId\":5,\"communityIds\":[5],\"content\":\"出土的东西和商周时期的中原文明越来越相似，青铜器的铸造工艺和成分配比几乎就是直接来源于中原文明。简单说就是部落养蚕织锦，通过贩卖丝绸，一方面获得中原文明技能书，一方面获得南亚部落的象牙，技能书里面有淘金和冶炼技术，象牙用来祭祀。青铜浇铸做脸壳儿和想象出来的神像，技术还没学到家，有些东西力学结构都没弄懂，刚刚铸出来没两天就垮丝成几截，做出来东西的厚薄都不一致。\\n\\n作者：书要麻烦\\n链接：https://www.zhihu.com/question/643810545/answer/3420043290\\n来源：知乎\\n著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。\",\"createBy\":\"16666666666\",\"estateId\":6,\"featuredId\":42,\"featuredSectionTypeId\":\"1787742998145036290\",\"featuredUrl\":\"http://file.community.szcjzhxq.com/statics/2024/05/07/图片1_20240507151548A009.png\",\"userId\":138}', '{\"msg\":\"添加成功\",\"code\":200}', 0, NULL, '2024-05-07 15:15:50', 0);
