INSERT INTO `sys_oper_log` VALUES (3126, '添加防控信息', 1, 'com.wr.estate.web.security.PreventController.addPrevent()', 'POST', 1, 'ESTATE_USER', '16555384880', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"告诫大家注重网络安全\",\"communityId\":1,\"content\":\"<p>涉及保护网络和连接设备的安全，包括但不限于防火墙、入侵检测系统、虚拟专用网络(VPN)等。实践措施如确保密码强度、使用双重身份验证、定期更新软件和固件等。此外，网络安全还涉及网络的监控和分析，以发现潜在威胁和漏洞。</p><p>应用程序安全。指的是保护计算机应用程序和软件的安全。措施包括开发安全的代码、使用输入验证、防止代码注入等。应用程序安全还涵盖访问控制、授权和审计等方面，是防止黑客攻击和数据泄露的重要手段。</p><p><br></p>\",\"createBy\":\"16555384880\",\"estateId\":1,\"imageUrl\":\"http://file.szcjzhxq.com/statics/2024/05/11/网络安全_20240511143925A026.png\",\"preventId\":26,\"preventTitle\":\"注重网络安全\",\"preventTypeId\":\"1789182982193025026\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-11 14:39:28', 0);
