INSERT INTO `sys_oper_log` VALUES (3128, '添加防控信息', 1, 'com.wr.estate.web.security.PreventController.addPrevent()', 'POST', 1, 'ESTATE_USER', '16555384880', NULL, '/prevent', '172.16.205.10', '', '{\"briefIntroduction\":\"公民是自己健康的第一责任人，每个人都应当树立和践行对自己健康负责的理念，同时，尊重他人的健康权利。\",\"communityId\":1,\"content\":\"<p>公民是自己健康的第一责任人，每个人都应当树立和践行对自己健康负责的理念，同时，尊重他人的健康权利。</p><p>每个人都要树立文明卫生意识，养成正确洗手、常通风、不随地吐痰、不乱扔垃圾、不在公共场所吸烟、保持社交安全距离、注重咳嗽礼仪、科学佩戴口罩、定期开展卫生大扫除等良好卫生习惯，倡导餐桌文明，提倡分餐，使用公勺公筷。</p>\",\"createBy\":\"16555384880\",\"estateId\":1,\"imageUrl\":\"http://file.szcjzhxq.com/statics/2024/05/11/防控信息2_20240511144751A028.png\",\"preventId\":28,\"preventTitle\":\"树立文明卫生意识 养成良好卫生习惯\",\"preventTypeId\":\"1789184046489276417\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-11 14:47:53', 0);
