INSERT INTO `sys_oper_log` VALUES (3398, '添加通知公告', 1, 'com.wr.estate.web.info.CommunityNoticeController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/notice', '172.16.205.10', '', '{\"briefIntroduction\":\"停水通知\",\"communityId\":1,\"communityIds\":[],\"content\":\"<p>亲爱的业主朋友们:</p><p>您好，接施工单位通知，今天(2023年11月28日)15:20-17:00彩金湖畔小区将停水对二次供水管道进行检修，为了确保您的日常生活不受影响，请您提前储备一些日常用水，并确保所有水龙头关闭，避免维修后突然供水造成不必要的困扰</p><p>我们深感对您带来不便，并再次表示真挚的歉意，感谢您对物业工作的理解与支持。</p><p>彩金湖畔物业中心</p><p>2023年11月28日</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"noticeId\":22,\"noticeTitle\":\"停水通知\",\"range\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-23 10:12:33', 0);
INSERT INTO `sys_oper_log` VALUES (3399, '添加通知公告', 1, 'com.wr.estate.web.info.CommunityNoticeController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/notice', '172.16.205.10', '', '{\"briefIntroduction\":\"管家休息\",\"communityId\":1,\"communityIds\":[],\"content\":\"<p>【管家休息】🌻 🌻 🌻</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 各位亲爱的业主，您的楼管周日（七月十六号）休息，☺ ☺ 有急事需要处理可致电前台0563-2025605</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 装修请遵循以下时间：周一到周五8：00-12：00，14：00-18：00其他时间和周末节假日严禁噪音施工！！</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 谢谢大家感谢各位的理解！祝大家生活愉快</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"noticeId\":23,\"noticeTitle\":\"管家休息\",\"range\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-23 10:14:16', 0);
INSERT INTO `sys_oper_log` VALUES (3400, '添加信息公示', 1, 'com.wr.estate.web.info.InvestController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"中考期间暂停装修施工作业\",\"communityId\":1,\"content\":\"<p>一年一度的中考即将来临，小区内在中考期间暂停装修施工作业，现将相关事项通知如下:</p><p><br></p><p>一、中考期间(时间:2023年6月14日至2023年6月16日)禁止装修施工。</p><p><br></p><p>二、在中考期间，请不要在小区、户内举办大型聚会活动，在夜间将家中电视、音响等设备的音量调小，以免影响考生休息。</p><p><br></p><p>三、小区内行车请自觉遵守交通规则，请勿争道和鸣笛，特别是早上外出，请提前并低速、安全、有序的出入，避免交通拥堵。</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"investTitle\":\"中考期间暂停装修施工作业\",\"investType\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-23 10:19:40', 0);
