INSERT INTO `sys_oper_log` VALUES (3448, '添加信息公示', 1, 'com.wr.estate.web.info.InvestController.add()', 'POST', 1, 'ESTATE_USER', '18888888888', NULL, '/invest', '172.16.205.10', '', '{\"briefIntroduction\":\"温馨提示\",\"communityId\":1,\"content\":\"<p>装修期间请注意</p><p>1、请勿破坏飘窗。</p><p>2、请勿破坏可视对讲的线路。</p><p>3、请做48小时闭水试验。</p><p>4、装修图纸需要表明改动部位。</p><p>5、装修时若需要封闭阳台，拆换窗户，所使用的型材、玻璃材质及颜色须与原阳台门或窗户保持一致（型材为深灰色铝合金，玻璃为中空钢化玻璃），确保房屋外立面统一和美观。</p><p>6、防盗窗需内装。</p><p>7、请勿安装雨棚、晾衣架。</p><p>8、院子下有管道，请勿乱挖，改动前请向物业报备。</p><p>6、垃圾须装袋、扎口并放到指定地点（G5-Y9之间地下车库B区260-265号）。</p>\",\"createBy\":\"18888888888\",\"estateId\":1,\"investTitle\":\"装修期间请注意\",\"investType\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-27 14:25:51', 0);
