INSERT INTO `sys_oper_log` VALUES (3576, '党员活动', 2, 'com.wr.govern.web.memberact.MemberActController.add()', 'POST', 1, 'GOVERN_USER', '15788888888', NULL, '/memberAct/add', '172.16.205.10', '', '{\"actTheme\":\"念好“三字诀” 推动“一月一课一片一实践\",\"address\":\"彩金小区党建室\",\"closeTime\":\"2024-05-31 20:10:53\",\"communityId\":1,\"content\":\"鼓励基层党组织创新方式、灵活方法讲好“微党课”，号召党员结合自身经历和工作实际，用小故事讲好大道理、以小切口阐述大主题。领导干部带头讲。动员各级党组织书记和党员领导干部利用党员大会、领导干部读书班、理论中心组学习等契机，走上台去为党员群众讲授“微党课”，发挥出“关键少数”的示范引领作用。动员榜样广泛讲。组织各级党代表、先进模范人物、在职党员、离退休党员等，上台讲“微党课”，为党员讲好“微党课”示范\",\"createBy\":\"15788888888\",\"endTime\":\"2024-06-11 00:00:00\",\"pictureUrl\":\"http://file.szcjzhxq.com/statics/2024/05/31/WechatIMG49071_20240531200611A311.jpg\",\"planStatus\":\"0\",\"startTime\":\"2024-06-01 00:00:00\",\"status\":\"0\",\"updateBy\":\"15788888888\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-05-31 20:06:13', 0);
